        int b = 0;
        int multiply = 0;
        try {
            Scanner sc = new Scanner(System.in);
            int input = sc.nextInt();
            if (input != 0) {
                int factor = input > 0 ? 1 : -1;
                for (; ; ) {
                    if (factor == input) {
                        break;
                    }
                    if ((input - factor) * factor > multiply) {
                        multiply = (input - factor) * factor;
                        a = input - factor;
                        b = factor;
                    }
                    if (input > 0) {
                        factor++;
                    } else {
                        factor--;
                    }
                }
            } else {
                a = -1;
                b = 1;
            }
        } catch (Exception e) {
        }
        System.out.println(Integer.min(a, b) + " "
                + Integer.max(a, b));
    }
}

