abstract class Student
{
    int no;
    String name;
    String sex;
    int score;
    Student()
    {
        no = 0;
        name = null;
        sex = null;
    };
    Student(int no, String name, String sex, int score)
    {
        this.name = name;
        this.no = no;
        this.sex = sex;
        this.score = score;
    }
    public Student(int no, String name, String sex)
    {
        this.name = name;
        this.no = no;
        this.sex = sex;
    }
    public void setSex(String sex)
    {
        this.sex = sex;
    }
    public void setNo(int no)
    {
        this.no = no;
    }

    public int getNo() {
        return no;
    }

    public String getName()
    {
        return name;
    }

    public String getSex()
    {
        return sex;
    }
    public int getScore()
    {
        return score;
    }
    public void setscore(int score)
    {
        this.score = score;
    }
    public abstract void getGrade();
    public void print()
    {
        System.out.println("no: "+getNo());
        System.out.println("name: "+getName());
        System.out.println("sex: "+getSex());
    }
}
