public class Main {
	public static boolean CheckRepeat(int n,int a[]) {
		int i,j;
		for(i=0;i<n-1;i++) {
			for(j=i+1;j<n;j++) {
				if(a[i]==a[j]) {
					return true;
				}
			}
		}
		return false;
	}
    public static void main(String[]args){
    	Scanner cin = new Scanner(System.in);

    	int n=cin.nextInt();
    	int[] a=new int[100000];
    	for(int i=0;i<n;i++) {
    		a[i]=cin.nextInt();
    	}

    	boolean res=CheckRepeat(n,a);

    	if(res) {
    		System.out.print("YES");
    	}else {
    		System.out.print("NO");
    	}
    }
}

